webpackJsonp([0xfeec4470403d],{7949:function(e,t){e.exports={data:{post:{html:"<p>PapaScott (the blog, not the man) took an unexpected <a href=\"http://flickr.ishavingamassage.com/\">massage</a> the past couple of days. My MySQL database seems to have disappeared from my hoster, just a couple of days after upgrading to WordPress 2.3. I didn't have time to track down the problem, I simply restored the last backup dump (which I mail to myself daily), which of course had character set issues (mixed latin1 and utf8 characters). But now we're running pure UTF-8 on MySQL 5.0, and everything should be fine until I have to restore from backup again.</p>",fields:{title:"Adieu DB",date:"29 Sep 2007",url:"https://papascott.de/2007-09-29-adieu-db/"}}},pathContext:{slug:"/2007-09-29-adieu-db/",prev:{fields:{title:"Bike Tour",date:"21 Sep 2007",slug:"/2007-09-21-bike-tour/"}},next:{fields:{title:"Deutschland Weltmeister. Again.",date:"30 Sep 2007",slug:"/2007-09-30-deutschland-weltmeister-again/"}}}}}});
